class Solution:
    def isSubsequence(self, s: "str", t: "str") -> "bool":

        last = 0
        for char in s:
            if char in t[last:]:
                last = t[last:].index(char) + last + 1
            else:
                return False
        return True


myClass = Solution()
result = myClass.isSubsequence("leeeeetcode", "")
print(result)
